import React from 'react';
import Card from './Card';


const Cardlist = ({robots}) => {
    return(
    <div>
        {
        robots.map((user,i) => {
            return (<Card key={robots[i].id} id={robots[i].id} name={robots[i].username} email={robots[i].email} />)
        })
        }
    </div>
    )
}
export default Cardlist;
